import React from "react";
import "./OrderForm.css";
import PizzaForm from "./PizzaForm";
function OrderForm(props) {
  return (
    <header>
      <div className="main">
        Teknolojik Yemekler
        <br />
        <nav>
          <div>
            <a href="#">Anasayfa - </a> <span> - </span>
          </div>
          <div>
            <a href="#"> Seçenekler - </a> <span> - </span>
          </div>
          <div>
            {" "}
            <a href="#">
              <b>Sipariş Oluştur</b>
            </a>
          </div>
        </nav>
      </div>
      <PizzaForm {...props} />
    </header>
  );
}

export default OrderForm;
